		[Test]
		public void ParseScores() {
			string json = @"[{'score_id':'173625185','score':'104382','username':'kevin3333g','maxcombo':'106','count50':'0','count100':'0','count300':'106','countmiss':'0','countkatu':'0','countgeki':'21','perfect':'false','enabled_mods':'1624','user_id':'374950','date':'2022 - 07 - 29 22:06:02','rank':'XH','pp':'102.289','replay_available':'true'}]";

			Scores score = JsonConvert.DeserializeObject<Scores[]>(json).First();

			Assert.AreEqual(score.ScoreId, 173625185);
			Assert.AreEqual(score.Score, 104382);
			Assert.AreEqual(score.Username, "kevin3333g");
			Assert.AreEqual(score.MaxCombo, 106);
			Assert.AreEqual(score.Count50, 0);
			Assert.AreEqual(score.Count100, 0);
			Assert.AreEqual(score.Count300, 106);
			Assert.AreEqual(score.CountMiss, 0);
			Assert.AreEqual(score.CountKatu, 0);
			Assert.AreEqual(score.CountGeki, 21);
			Assert.IsFalse(score.Perfect);
			Assert.AreEqual(score.EnabledMods, Mods.Hidden | Mods.HardRock | Mods.DoubleTime | Mods.Nightcore | Mods.Flashlight);
			Assert.AreEqual(score.UserId, 374950);
			Assert.AreEqual(score.DateTime, new DateTime(2022, 07, 29, 22, 06, 02));
			Assert.AreEqual(score.Rank, "XH");
			Assert.AreEqual(score.PP, 102.289f);
			Assert.IsTrue(score.ReplayAvailable);
		}

